    false,nt"url": null,nt"notes": "This annual narrative report for Swan Lake
    National Wildlife Refuge summarizes Refuge activities during the 1994 calendar year.
     The report begins with a summary of the yearu2019s highlights and climatic conditions.
     Land acquisition is also covered.  The report includes a planning section which
    discusses the management plan, public participation, and compliance with environmental
    and cultural resource mandates.  Refuge administration is outlined; information
    about personnel, youth programs, volunteer programs, funding, safety, and technical
    assistance is given.  Habitat management is also covered.  Subjects include wetlands,
    forests, croplands, grasslands, fire management, and pest control.  The wildlife
    section of the report discusses wildlife diversity, endangered species, threatened
    species, waterfowl, marsh birds, waterbirds, shorebirds, raptors, game mammals,
    fisheries resources, wildlife propagation and stocking, marking, banding, and disease
    control.  The public uses of the Refuge described in this report include outdoor
    classrooms, interpretive exhibits, hunting, fishing, wildlife observation, camping,
    law enforcement, and cooperating associations.  The equipment and facilities section
    of the report provides information about new construction, rehabilitation, major
    maintenance, and equipment utilization/replacement.  Cooperative programs and items
    of interest are provided at the end; Refuge brochures are attached.",nt"license_title":
